  false,\n\t\"url\": null,\n\t\"notes\": \"A significant eruption is classified as
  one that meets at least one of the following criteriacaused fatalities, caused moderate
  damage (approximately $1 million or more), Volcanic Explosivity Index (VEI) of 6
  or greater, generated a tsunami, or was associated with a significant earthquake.The
  database contains information on the latitude, longitude, elevation, type of volcano,
  last known eruption, VEI index, and socio-economic data such as the total number
  of casualties, injuries, houses destroyed, and houses damaged, and $ dollage damage
  estimates, if available.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
